    "Temperature and current data collected as part of the CLIvar MOde Water Dynamic
    Experiment (CLIMODE) mooring data from 2005-11 to 2007-11 in the North Atlantic,
    south-east of the Gulf Stream (NCEI Accession 0127259)",nt"tracking_summary":
    {ntt"total": 1,ntt"recent": 0nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-02-26T22:16:01.226438",nt"name": "temperature-and-current-data-collected-as-part-of-the-clivar-mode-water-dynamic-experiment",nt"isopen":
    false,nt"url": null,nt"notes": "Two years of temperature, salinity, current,
    and nutrient data were collected on four subsurface moorings as part of a two-year
    field component of the CLIMODE experiment. This accession contains the temperature
    and current data from this experiment.The moorings were located in the North Atlantic's
    subtropical gyre, southeast of the Gulf Stream. Two moorings, the most heavily instrumented,
    were close to the Gulf Stream, in the region where cold air outbreaks force large
    air-sea fluxes and where Eighteen Degree Water outcrops. Two other moorings were
    located farther south and carried more limited instrumentation. The moorings were
    initially deployed in November of 2005, turned around in November of 2006, and finally
    recovered in November of 2007. During the first year, the moorings close to the
    Gulf Stream suffered considerable blow down, and some of the instruments failed.
    During the second year, the blow down was greatly reduced and most instruments collected
    a full yearu00c3u00a2u00c2u0080u00c2u0099s worth of data.",nt"license_title":
